import React from 'react';
import '../styles/index.css';

export default class Card extends React.Component{
    render(){
        console.log(this.props)
        return (
            <div className="card text-center m-2">
                <div className='card-header text-muted'>{this.props.day}</div>
                <div className="card-body">
                    <img src={this.props.currentWeather.wheatherImage} className="card-img" alt="..." />
                </div>
                <div className="card-footer">
                    <span className="card-text">{this.props.currentWeather.dayTemperature} </span>
                    <span className="card-text text-muted">{this.props.currentWeather.nightTemperature}</span>
                </div>    
            </div>
        )
    }
}
